var dashboardModule=new Vue({el:"#root",data:{debug:DEBUGMODE,loader:!0,users:[],files:[],pages:[],forms_types:[],albumes:[],content:[],api_data:{dashboard:BASEURL+"api/v1/dashboard/"}},mixins:[mixins],methods:{init(){setTimeout(()=>{var e=document.querySelectorAll(".dropdown-trigger");M.Dropdown.init(e,{});e=document.querySelectorAll(".collapsible");M.Collapsible.init(e,{})},3e3)},getDashboardData(){fetch(this.api_data.dashboard).then(e=>e.json()).then(e=>{let s=e.data;this.users=s.users?s.users.map(e=>new User(e)):[],this.pages=s.pages?s.pages.map(e=>(e.user=new User(e.user),e)):[],this.forms_types=s.forms_types?s.forms_types:[],this.content=s.content?s.content.map(e=>(e.user=new User(e.user),e.status="1"==e.status,e)):[],this.files=s.files?s.files.map(e=>new ExplorerFile(e)):[],this.albumes=s.albumes?s.albumes.map(e=>(e.user=new User(e.user),e)):[],this.loader=!1,this.init()}).catch(e=>{console.error(e)})}},mounted:function(){this.$nextTick(()=>{this.getDashboardData()})}});